import "./styles.css";
import React, { useEffect, useState } from "react";
import MyComponent from "./component";


export default function App() {


  const [result, setResult] = useState(0);
  const [count, setCount] = useState("0");

  let buttonList = [];
  for (let i = 1; i < 10; i++) {
    buttonList.push(
      <button key={i} value={i} onClick={(e) => add(e)}>
        {i}
      </button>
    );
  }

  function reset() {
    setResult(0);
    setCount("0");
  }

  function add(e) {
    if (count === "0") {
      setCount(e.target.value);
    } else {
      setCount((curr) => curr + e.target.value);
    }
  }


//   function checkUserData() {
//     if(count === 'Personnummer'){
//         writeUserData()
//         //console.log(persondata.map(Personnummer => ( Personnummer.Personnummer)))
//     }
//         else {
//             console.log("SORRY")
//             //console.log(persondata.map(Personnummer => ( Personnummer.Personnummer)))
//     }
//     setCount("0");
// }

var d = new Date();
var datestring = d.getFullYear() + "-" + (d.getMonth()+1)  + "-" + d.getDate()
var Today = new Date().toLocaleString()

  // function writeUserData() {
  //   const db = getDatabase();
  //   push(ref(db, 'Tidslogg/'), {
  //     Fornamn: 'Fornamn',
  //     Efternamn: 'Efternamn',
  //     Personnummer : count,
  //     TidIn: new Date().toLocaleString(),
  //     Dag: datestring
  //   });
  //   setCount("0");
  // }

  // function writePersonUserData() {
  //   const db = getDatabase();
  //   push(ref(db, 'Personuppgifter/'), {
  //     Fornamn: 'Frida',
  //     Efternamn: 'Romare',
  //     Personnummer : '9702251480'
  //   });
  // }

  return (


    <div className="App">
        <div className="boxContainer">
        <h1 className="title">Lummelunda Grill</h1>
    <div className="Calculator">

      <div className="flex">
        <div className="counter">
          <h1>{count === "1" ? result : count}</h1>
        </div>
      </div>

      <div className="flex">
        <div className="buttons btn-style">
          {buttonList}
          <button onClick={reset}>X</button>
          <button value={0} onClick={(e) => add(e)}>
            0
          </button>
          {/* <button onClick={checkUserData}>In</button> */}
          {/* <button onClick={writePersonUserData}>Lägg till</button> */}
        </div>

      </div>

    </div>


    <div className="datablock">

<section>
  <h2>Personalliggare</h2>
  <h2>{Today}</h2>
  <div className="tbl-content">
    <table cellPadding="2" cellSpacing="2" border="2">
      <tbody>
      <tr>
    <th>Förnamn</th>
    <th>Efternamn</th> 
    <th>Personnummer</th>
    <th>Tid in</th>
  </tr>
  <MyComponent />
  {/* {data.map(item => <div key={item.id}>{item.fornamn}</div>)}  */}
  {data.map((item) => (
  <tr>
    <td key={item.id}>{item.fornamn}</td>
    <td key={item.id}>{item.efternamn}</td>
    <td key={item.id}>{item.personnummer}</td>
    <td key={item.id}>{item.tidin}</td>
  </tr>
    ))}
      </tbody>
    </table>
  </div>
</section>
        </div>

        </div>
        <footer>
        <p>
            Lummelunda Grill
        </p>
        <p>
            Orgnr
        </p>
      </footer>
    </div>
  );
}
